import React from "react"
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
} from 'react-router-dom';

const Hat = ()=>{
    
    return(
        <div className="row">
            <div className="into_row">
            <Link to="/Position">Position</Link>
            </div>
            <div className="separator"></div>
            <div className="into_row">
            <a href="/Traders">Traders</a>
            </div>
        </div>    
    )


}

export default Hat
